/**
 * Create one or more `Element`s from a CSS selector.
 *
 * @param {string | null | undefined} [selector='']
 *   CSS selector (default: `''`).
 * @param {Options | null | undefined} [options]
 *   Configuration (optional).
 * @returns {HastElement}
 *   Built tree.
 */
export function fromSelector(selector?: string | null | undefined, options?: Options | null | undefined): HastElement;
export type AstAttribute = import('css-selector-parser').AstAttribute;
export type AstRule = import('css-selector-parser').AstRule;
export type HastElement = import('hast').Element;
export type HastProperties = import('hast').Properties;
/**
 * Configuration.
 */
export type Options = {
    /**
     * Which space first element in the selector is in (default: `'html'`).
     *
     * When an `svg` element is created in HTML, the space is automatically
     * switched to SVG.
     */
    space?: Space;
};
/**
 * Name of namespace.
 */
export type Space = 'html' | 'svg';
/**
 * Info on current context.
 */
export type State = {
    /**
     *   Current space.
     */
    space: Space;
};
